{"title": "Video by filmabhibaakihai", "description": "This scene from Bajrangi Bhaijaan is one of my favourites.

I have always admired the film. At its core, it’s a story about love. A love that binds two strangers. A love that transcends borders, religions, and every man-made divide. A love that binds two people who need nothing but each other to feel at home. When Pawan sees Munni praying in the dargah, the truth is right in front of him. The very thing he feared—her being from ‘the other side’—is now undeniable. But what does he do? He hugs her, just as tightly as before. He learns from Rasika that it doesn't really matter where she is from or which religion she follows. At that moment, he isn’t thinking about where she’s from or what she believes in. He’s thinking about her. His Munni. And that’s exactly what the film stands for—love, in its purest form.

