{"title": "Video by still_sinema", "description": "“I don’t want to be strong. I just want to be normal.”

This heart-wrenching scene from Dil Bechara (2020) captures the raw emotions of Kizzy Basu (played by Sanjana Sanghi) as she bravely battles thyroid cancer. She reminds us that strength isn’t always about fighting / sometimes it’s just about wanting to live, love and dream like everyone else;

From laughing out loud to daydreaming about her favourite musician Abhimanyu Veer, Kizzy beautifully expresses the simple joys she craves amid her battle with her illness. Her oxygen cylinder Pushpinder may keep her breathing, but her words are what bring this powerful moment to life;

Dil Bechara is not just a movie / It is an emotional journey that teaches us about hope, love and embracing life no matter how difficult the times are;

Some wishes are small, but they mean the world💔

